(13, '1.0_OUTBOUND_ENROLLMENT_MANAGER_PP_REGISTRATION', 'OUTBOUND ENROLLMENT MANAGER PASS PROVIDERS ( REGISTRATION )', 'THIS ENROLLMENT MANAGER SHALL WORK FOR  REGISTRATION OF USERS ON PASS PROVIDERS PORTAL THROUGH FRON END AS WELL AS THROUGH CRM( BACK END )', 1, 1, NULL, '2020-08-27 08:26:24', '2021-06-21 23:30:12'),
(14, '2.02_TRANSPORT_MANAGER_GOEL__ASSOCIATES', 'Transport Manager Goel Associates', 'THIS RELATIONSHIP MANAGER SHALL WORK FOR  Arranging lorries for goel associates for coal sales operations', 1, 1, NULL, '2020-08-27 08:26:39', '2021-06-21 18:10:35'),
(15, '2.05_LOADING_MANAGER_GOEL_ASSOCIATES', 'LOADING MANAGER GOEL ASSOCIATES', 'THIS Loading MANAGER SHALL WORK FOR  checking quality of coal and shall handle loading of coal at port, for lorries arranged by transport manager for goel associates for coal sales operations.', 1, 1, NULL, '2020-08-27 08:26:51', '2021-06-21 18:10:17'),
(16, '2.4_ACCOUNTS_MANAGER_GOEL__ASSOCIATES', 'ACCOUNTS MANAGER GOEL ASSOCIATES', 'THIS ACCOUNTS MANAGER SHALL WORK FOR  managing accounts for goel associates for coal sales operations in backend operations and shall also approve for directions for loading coal. ', 1, 1, NULL, '2020-08-27 08:27:23', '2021-06-21 18:08:32'),
(17, '1_ADMIN_PASSPROVIDERS_BACKEND', 'PRODUCT MANAGER  ADMIN PASS PROVIDERS', ' Admin In Back End Office Of Pass Providers', 1, 1, NULL, '2020-08-27 08:28:03', '2021-06-24 21:16:40'),
(18, '2.5_UNLOADING_MANAGER__GOEL_ASSOCIATES', 'UNLOADING MANAGER GOEL ASSOCIATES At Destination', 'responsibility of unloading manager is to arrange unloading of coal at destination and to report quality of material reached at destination. \r\n\r\nTHIS MANAGER SHALL WORK FOR  Arranging lorries for goel associates for coal sales operations', 1, 1, NULL, '2020-08-27 08:29:40', '2021-06-21 18:08:46'),
(19, '1.1_OUTBOUND_RELATIONSHIP_MANAGER_LEAD_GENERATION_PASS_PROVIDERS', 'OUTBOUND RELATIONSHIP MANAGER FOR LEAD GENERATION PASS PROVIDERS', 'THIS RELATIONSHIP MANAGER SHALL Work FOR LEAD GENERATION for PASS PROVIDERS PORTAL FROM BACK END \r\n', 1, 1, NULL, '2020-08-27 08:30:13', '2021-06-21 23:32:09'),
(20, '2.01_DISTRIBUTOR_GOEL_ASSOCIATES', 'DISTRIBUTOR GOEL ASSOCIATES', 'The responsibility of distributor is to add users on pass providers portal, arrange sales orders of coal on commission basis on Goel associates b2c portal, book sales, create new Ibc and distributors and get payment transferred to goel associates by bank. \r\n', 1, 1, NULL, '2020-09-20 20:00:24', '2021-06-21 18:09:13'),
(21, '1.4_EMPLOYEE_PASS_PROVIDERS', 'EMPLOYEE PASS PROVIDERS', 'For managing all development related work for pass providers', 1, 1, NULL, '2020-09-20 20:01:06', '2021-06-21 18:42:25'),
(22, '2.0_IBC_GOEL_ASSOCIATES', 'Independant Business Consultant for GOEL ASSOCIATES', 'The responsibility of Ibc is to add users on pass providers portal, arrange sales orders of coal on commission basis on Goel associates b2c portal, book sales, create new Ibc and distributors and get payment transferred to goel associates by bank. \r\n', 1, 1, NULL, '2020-09-24 12:05:15', '2021-06-21 18:10:02'),
(23, '3.0_ENROLLMENT_EXECUTIVE_FUEL_MANTRA', 'ENROLLMENT EXECUTIVE  FUEL MANTRA', 'The responsibility of ENROLLMENT EXECUTIVE  FUEL MANTRA is to get users registered on fuel mantra portal and application .', 1, 1, NULL, '2020-10-16 19:22:45', '2021-06-21 18:10:55'),
(24, '2.7_AUDITOR_GOEL_ASSOCIATES', 'Auditor before and after billing goel associates', 'THIS Loading MANAGER SHALL WORK FOR  checking quality of coal and shall handle loading of coal at port, for lorries arranged by transport manager for goel associates for coal sales operations.', 1, 1, NULL, '2020-10-28 11:45:25', '2021-06-21 18:11:25'),
(25, '3.3_SENIOR_EXECUTIVE__FUEL__MANTRA', 'SENIOR EXECUTIVE FUEL MANTRA ', 'The responsibility of SENIOR EXECUTIVE  FUEL MANTRA is to manage operations of fuel mantra portal and application .', 1, 1, NULL, '2020-11-10 11:32:15', '2021-06-21 18:11:53'),
